} この x という局所変数自体はスタックに確保されている。 だから一見すると上の説明は変に見える。 もっとしっかりした説明だと、 x にはある配列へのポインタと配列の長さの情報が入っているらしい。 だから、x の"本体"はヒープに入っている。 これについて書く。 例えば、 x[0] は 場所 である。 （ place expression のうち、 array indexing と呼ばれる path expression に含まれる。） Vec 型の場合、これはヒープの中のある場所を指している。 fn main() { let x = vec![0_usize, 1_usize]; let y = &x[0];
} Vec 意外だと Box が一番身近な気がする。 fn main() { let x = Box::new(String::new()); let z = *x;
} ちなみにこれは普通じゃない挙動（ move behind reference ができているので） 注意点として、allocation が必ず起こるとは限らない。 もちろん、 rust のコード上では、 Allocator が使われるが、最適化の前後で消えうる。 ref なので、rust の意味論の中でのヒープが、そのまま実行中のプログラムでのヒープに対応するわけじゃない。 nested な場合 fn main() { let x = Box::new(Box::new(String::new())); let y: &Box<String> = x.as_ref();
} なにをやりたかったか忘れた。

