Box はコンパイラが特別扱いしてくれるらしい。 fn main() { let x = Box::new(String::new()); let y = *x; // move behind reference!
} * のあとは参照値を表す式が来ることになっているから、 x: Box を参照値として解釈するはずだが、 参照値経由で move が起こせている。 ただし、つぎはだめみたい。 fn main() { let x = Box::new(String::new()); let y = *(x.as_ref()); // move behind reference! => error
} こう見ると、 *x と *(x.as_ref()) ではちょっと違うね。 ただ、 y = *x で x が Copy じゃないのに move が起こせるケースは、他にはぱっと思いつかない。 つまり、次のコードの T になれるようなやつ。 fn f<T>(x: &T) { let y = *x;
} と書いて思ったけどなんかやりたかったことと違うな。 ここらへんは、関数の境界をまたぐとできなくなることが多いので気を付けたい。 Deref を経由する形にもできるけど、 Box はそれ以上の扱いを受けている。 その点では、 struct の field access に似ている...とおもったら同じような解説があった。 （ ref の 3 つめ。） これを考えると、場所の projection としての扱いを受けているような気がする。

