場所 x などに対して &x や &mut x とすることで、その場所を指し示す値を作ることができる。 これが参照である。 （本当は shared reference と exclusive reference といった方が、 rust での扱いが正しい？） 参照値 p に対しては *p でその指し示された場所を得ることができる。 不変参照の基本例 次のようにして不変参照が使える。 fn main() { let x: usize = 1; let y: &usize = &x; print!("{}", *y);
} 1 &xでxという 場所を指し示す値 （＝参照値）が作れる。 e が参照なら、*eで指し示された場所に入っている値（＝xの持っている値）を見ることができる。 可変参照の基本例 mutをつけることで書き換えることができる参照を作れる。 fn main() { let mut x: usize = 1; let y: &mut usize = &mut x; *y = 2; // `y` に入っている参照値経由で`x`の持っている値を書き換える。 print!("{}", *y);
} 上の例は次のようにも書ける。 fn main() { let mut x: usize = 1; *(&mut x) = 3;
} ある意味では、下の使い方の方が想定されていると思ってもいい。 * の後につくのは（参照）値のはずだから。 * の後に場所が来た場合には、その場所に入っている参照値を dereference するものと考える。 （let z = 1 と let x = 1; let z = x の違いのとらえ方と同じ。） 複雑な式の例 fn main() { let mut x: usize = 1; let mut y: usize = 1; *(if true {&mut x} else {&mut y}) = 2;
} こういうのも書けるんだ。 参照が付いたら場所の例 qnighy さんのスライド ref を見て、面白い例があったのでここに追記する。 fn main() { *(&mut 1) = 2;
} これのコンパイルが通る理由は、 & や &mut がついた時点で、それは場所を表していると解釈されるため、 1という値を持つ場所（一時変数）への参照を表すと解釈されるので、 上はその一時変数の書き換えの式になる。

