NLL における lifetime は "set of points in the control-flow graph" として定義されている。 この control-flow というのが重要で、（分岐以外にもブロックが逐次出てくる場合も含めて）、 rust のプログラムの { } で記述されている部分というのは、「各ラベル付き（MIR）ブロックが辺（terminator）でつながっている」コードと思える。 control-flow graph の点はこの辺のことと思える。 （文と文の間とかに点が設定されるが、ここでは文に設定されてると思ってしまう。） 逐次と nested なブロックの場合だけやる。 各ブロックとジャンプ先を書く。 各 reference の型を持つ値と場所に、 lifetime 変数 をつける。 fn main() { // block a; let mut y: &usize; // &'y usize // goto b; { // block b let x = 1; y = &x; // &'x usize print!("{}", *y); // `y` used => `y` should lives => 'x outlives 'y at this line } // goto c; { // block c let z = 2; y = &z; // &'z usize print!("{}", *y); // `y` used => `y` should lives => 'z outlives 'y at this line } // return fn;
} borrow checker は、この情報をもとに reference や lifetime がどこまで生きる べき かを計算し、制約が満たせるか判定する。 ここでこの制約は、「point p で、lifetime L1 が L2 よりも長い」というように、単に lifetime を比較せずに、 at point p という形にするのが、 NLL の重要な点である。 例えば先のコードだと古典的に考えれば、'x は 'y よりも真に短いのに、 &'y usize に 'x usize が代入できているのでおかしい。 NLL の考え方だと、そもそも 'y に関する制約が生まれるのは、2つの点だけになる。 そして、 'y は 自由な変数 である。 つまり、'y が結局どこまでかを（制約を満たす限り） NLL が決めてもいい。 制約としては 'x : 'y at block b の y = &x 'y: {at print!} at block b の println!(..) 'x : 'z at block b の y = &z 'y: {at print!} at block c の println!(..) この制約を満たすように、minimal にとることができる： 'x は &x が作られてからブロックの最後まで 'z は &z が作られてからブロックの最後まで 'y は、ちょうど y が登場している行全部 だから、このプログラムは borrow checker が妥当と判断している。 もうちょっと複雑な例 fn main() { let mut y: &String; let mut x: String = String::from("hello"); y = &x; println!("{x}"); y = &x; println!("{x}");
} ちゃんと書かないけど、この例の場合は 変数 y の型には &'y usize としてライフタイム 'y を割り振る 各 &x の登場ごとに 'x1 と x2 という 参照値のライフタイム を割り振る x という場所のスコープとは別に、ここで作られた参照値がどこまで使えるかを表す。 としてライフタイム変数 'y と 'x1 と 'x2 の制約問題を解く。 y = &x から 2 つの制約がそれぞれの行で発生する。 あと、 print!("{x}") は x が使われているので、 &x を殺す 必要がある。 （RFCの中で、 constrait についての議論では、どこまで生きるべきかは議論してたけど、 いつまでに死ぬべきかは全然書かれてなかった。なんで？） その制約を守れば well-formed なライフタイムができあがる。

